n          &lt;li&gt; Workers: 16 &lt;/li&gt;\n          &lt;li&gt; Threads: 384 &lt;/li&gt;\n          &lt;li&gt; Memory: 2.70 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport time\nfrom dask.distributed import performance_report, Client\nimport json \nfrom dask_ml.decomposition import InSituIncrementalPCA\nimport time \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr) #, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr) #, timeout=60, heartbeat_interval=10)\n    return client\n\n\n# Get client\nclient = connect(scheduler_info)\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    \n    pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n    print(\"pca, \", pca, flush=True)\n\n    l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1432","type":"BasicTickFormatter"},{"attributes":{},"id":"1484","type":"DatetimeTickFormatter"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"child":{"id":"1400"},"title":"Scheduler Logs"},"id":"1410","type":"Panel"},{"attributes":{},"id":"1485","type":"AllLabels"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"axis":{"id":"1259"},"coordinates":null,"group":null,"ticker":null},"id":"1262","type":"Grid"},{"attributes":{"coordinates":null,"data_source":{"id":"1002"},"glyph":{"id":"1031"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1033"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1035"}},"id":"1034","type":"GlyphRenderer"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1512","type":"AdaptiveTicker"},{"attributes":{"coordinates":null,"group":null,"text":"Memory"},"id":"1250","type":"Title"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"1513","type":"AdaptiveTicker"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1514","type":"AdaptiveTicker"},{"attributes":{"axis":{"id":"1197"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"
